echo "Running Test script for q3"
checktest(){
    if [ x"$fail" = x1 ] ; then
	echo "  FAILED"
	failedtests="$failedtests $1"
    else
	echo "  SUCCESS"
    fi
    fail=
}

startFuse() {
	rm -f testFuse.img
	rm -rf fuseDir
	./mktest testFuse.img
	mkdir fuseDir
	./homework -image testFuse.img ./fuseDir
